import { ADD_DIARY, GET_DIARIES } from '../actions/types';

const initialState = {
    diaries: []
}

export default function (state = initialState, action) {
    switch (action.type) {
        case ADD_DIARY:
           return {
            ...state,
            diaries: [action.payload, ...state.diaries]
           }
        case GET_DIARIES:
            return action.payload
        default:
            return state;
    }
}
